import './App.css';
import Home from './components/home/home';
import Fitness from './components/fitness/fitness';
import Tech from './components/tech/tech';
import CommonBlog from './components/blog/blog';
import TechData from './components/tech/tech-data.json'
import { BrowserRouter,Routes,Route } from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/fitness" element={<Fitness />} />
          <Route path="/fitness/:id" element={<CommonBlog />} />
          <Route path="/tech" element={<Tech />} />
          <Route path="/tech/:id" element={<CommonBlog data={TechData} />}  />
        </Routes>

      </BrowserRouter>
    </div>
  );
}

export default App;
